const portalNames = zoneNames.filter(e => e.includes('-'))

const zoneTypeMap = {
      STARTINGCITY: 0,
      CITY: 1,
      SAFEAREA: 2,
      YELLOW: 3,
      RED: 4,
      BLACK: 5,
      _ROAD_: 6
    }

interface AO2DNode {
  x: number
  y: number
  exits: Array<{ _attr: AO2DExitAttrs }>
  _attr: AO2DNodeAttrs
}

interface AO2DNodeAttrs {
  categoryname: string
  displayname: string
  editoroffset: string
  enabled: string
  file: string
  id: string
  minimapBaseLevel: string
  minimapBoundsMax: string
  minimapBoundsMin: string
  minimapHeightRange: string
  origin: string
  rareresourcedistribution: string
  size: string
  speciallocation: string
  timeregion: string
  type: string
  worldmapposition: string
}

interface AO2DExitAttrs {
  id: string
  pos: string
  proximitytooltiptype: string
  restricted: string
  roadtype: string
  targetid: string
  targettype: string
  territory: string
}

const nodes = data.nodes as AO2DNode[]

export const toSnakeCase = (val: string) => val
  .replace(/'/g,'')
  .replace(/\W+/g, ' ')
  .split(/ |\B(?=[A-Z])/)
  .map(word => word.toUpperCase())
  .join('_')

const match = ['SAFEAREA', 'OPENPVP_YELLOW', 'OPENPVP_RED', 'PLAYERCITY_BLACK', 'PLAYERCITY_BLACK_ROYAL', 'STARTINGCITY']
const include = ['PLAYERCITY_SAFEAREA_0', 'OPENPVP_BLACK', 'PLAYERCITY_BLACK_PORTALCITY']
const exclude = ['BRECILIEN']
const validNodes = nodes.filter(e => {
  const { enabled, type, displayname } = e._attr
  if (String(enabled) === 'false') return false
  if (exclude.some(m => toSnakeCase(displayname).includes(m))) return false
  if (match.some(m => type === m)) return true
  if (include.some(m => type.includes(m))) return true
  return false
})

const formattedZones = validNodes.map(e => ({
  id: Number(e._attr.id),
  displayName: e._attr.displayname,
  position: [e.x, -e.y],
  type: (() => {
    for (const [type, index] of Object.entries(zoneTypeMap))
      if (e._attr.type.includes(type)) return index
    return -1
  })(),
  connections: e.exits.map(({ _attr: { targetid } }) => Number(targetid.split('@')[1]))
}))

const uniqueIds = new Set<number>()
formattedZones.forEach(item => uniqueIds.add(item.id))

const portalZoneNameToEntity = new Map<string, typeof formattedZones[number]>()
for (const zone of formattedZones) {
  zone.connections = zone.connections.filter(exit => uniqueIds.has(exit))
  if (zone.displayName.includes('Portal')) portalZoneNameToEntity.set(zone.displayName, zone)
}

$: for (const zone of formattedZones) {
  for (const portalName of portalZoneNameToEntity.keys()) {
    const lookupName = portalName.replace(" Portal", "")
    if (zone.displayName === lookupName) {
      const entity = portalZoneNameToEntity.get(portalName)
      if (!entity) throw new Error('')
      zone.connections.push(entity.id)
      entity.connections.push(zone.id)
      portalZoneNameToEntity.delete(portalName)
      continue $
    }
  }
}

formattedZones.sort((a, b) => a.id - b.id)

for (let i = 0; i < formattedZones.length; i++) {
  const zone = formattedZones[i]
  const oldZoneId = zone.id
  const newZoneId = i
  zone.id = newZoneId
  zone.connections.forEach(connection => {
    const connectionZone = formattedZones.find(e => e.id === connection)
    if (!connectionZone) return
    const zoneIndex = connectionZone.connections.indexOf(oldZoneId)
    connectionZone.connections.splice(zoneIndex, 1, newZoneId)
  })
}

const indexShift = formattedZones.length
for (let i = 0; i < portalNames.length; i++) {
  const portalName = portalNames[i]
  formattedZones.push({
    id: indexShift + i,
    displayName: portalName,
    position: [0, 0],
    type: 6,
    connections: []
  })
}

// Helper functions
function stringToUtf8Bytes(str: string): Uint8Array {
  return new TextEncoder().encode(str);
}

function utf8BytesToString(bytes: Uint8Array): string {
  return new TextDecoder().decode(bytes);
}

// Serialize function
function serialize(obj: typeof formattedZones): ArrayBuffer {
  const buffers: ArrayBuffer[] = [];

  obj.forEach((item) => {
    // Serialize id
    const idBuffer = new Uint32Array([item.id]).buffer;

    // Serialize displayName
    const displayNameBytes = stringToUtf8Bytes(item.displayName);
    const displayNameLengthBuffer = new Uint32Array([displayNameBytes.length]).buffer;

    // Serialize position
    const positionLengthBuffer = new Uint32Array([item.position.length]).buffer;
    const positionBuffer = new Float64Array(item.position).buffer;

    // Serialize type
    const typeBuffer = new Uint32Array([item.type]).buffer;

    // Serialize connections
    const connectionsLengthBuffer = new Uint32Array([item.connections.length]).buffer;
    const connectionsBuffer = new Uint32Array(item.connections).buffer;

    // Add buffers
    buffers.push(
      idBuffer,
      displayNameLengthBuffer,
      displayNameBytes.buffer,
      positionLengthBuffer,
      positionBuffer,
      typeBuffer,
      connectionsLengthBuffer,
      connectionsBuffer
    );
  });

  // Concatenate all buffers
  return buffers.reduce((acc, buffer) => {
    const tmp = new Uint8Array(acc.byteLength + buffer.byteLength);
    tmp.set(new Uint8Array(acc), 0);
    tmp.set(new Uint8Array(buffer), acc.byteLength);
    return tmp.buffer;
  }, new ArrayBuffer(0));
}

import fs from 'node:fs'
fs.writeFileSync('./Data/zones.bin', Buffer.from(serialize(formattedZones)));
